In C, static variables and register variables are two types of storage class specifiers that can be used to declare variables. Here's a brief overview of each:

**Static Variables**

A static variable is a variable that retains its value between function calls. When a function is called, the static variable is initialized only once, and its value is preserved across subsequent calls to the function. This means that the variable is not reinitialized every time the function is called.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    static int count = 0;
    count++;
    printf("%d\n", count);
}

int main() {
    my_function(); // prints 1
    my_function(); // prints 2
    my_function(); // prints 3
    return 0;
}
```
In this example, the `count` variable is initialized to 0 only once, when the `my_function` is first called. Subsequent calls to the function increment the value of `count`, which is preserved between calls.

**Register Variables**

A register variable is a variable that is stored in a CPU register, rather than in memory. This can improve performance by reducing the number of memory accesses. However, the use of register variables is generally discouraged, as it can make the code less portable and more difficult to understand.

Here's an example:
```c
#include <stdio.h>

void my_function() {
    register int x = 5;
    printf("%d\n", x);
}

int main() {
    my_function(); // prints 5
    return 0;
}
