function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 8);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 8, entity.id & 0x0F);
        view.setUint8(i * 8 + 1, (entity.id >> 4) & 0x0F);
        view.setUint8(i * 8 + 2, (entity.id >> 8) & 0x0F);
        view.setUint8(i * 8 + 3, (entity.id >> 12) & 0x0F);
        view.setUint8(i * 8 + 4, (entity.size >> 0) & 0x07);
        view.setUint8(i * 8 + 5, (entity.size >> 3) & 0x07);
        view.setUint8(i * 8 + 6, (entity.size >> 6) & 0x07);
        view.setUint8(i * 8 + 7, (entity.size >> 9) & 0x07);
    }
    return buffer;
}

function unpackEntities(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength / 8; i++) {
        let entity = {
            id: (view.getUint8(i * 8) | (view.getUint8(i * 8 + 1) << 4) | (view.getUint8(i * 8 + 2) << 8) | (view.getUint8(i * 8 + 3) << 12)) & 0x0F,
            size: (view.getUint8(i * 8 + 4) | (view.getUint8(i * 8 + 5) << 3) | (view.getUint8(i * 8 + 6) << 6) | (view.getUint8(i * 8 + 7) << 9)) & 0x07
        };
        entities.push(entity);
    }
    return entities;
}
